CREATE TABLE `agencias` (  `numero` bigint(20) NOT NULL AUTO_INCREMENT,  `nome` varchar(30) DEFAULT NULL,  `endereco` varchar(30) DEFAULT NULL,  `cep` int(11) DEFAULT NULL,  `cidade` varchar(30) DEFAULT NULL,  `uf` char(2) DEFAULT NULL,  `telefone` bigint(20) DEFAULT NULL,  PRIMARY KEY (`numero`));
CREATE TABLE `gerentes` (  `registro` bigint(20) NOT NULL AUTO_INCREMENT,  `cpf` bigint(20) NOT NULL,  `rg` varchar(14) NOT NULL,  `pnome` varchar(15) NOT NULL,  `mnome` varchar(100) NOT NULL,  `unome` varchar(15) NOT NULL,  `nascimento` date DEFAULT NULL,  `email` varchar(30) DEFAULT NULL,  `telefone` bigint(20) DEFAULT NULL,  `endereco` varchar(30) DEFAULT NULL,  `cidade` varchar(30) NOT NULL DEFAULT 'Caraguatatuba',  `uf` char(2) NOT NULL DEFAULT 'SP',  `cep` int(11) DEFAULT NULL,  `sexo` char(1) DEFAULT NULL,  `salario` decimal(10,2) DEFAULT NULL,  `admissao` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,  `salarioant` decimal(10,2) NOT NULL,  PRIMARY KEY (`registro`),  UNIQUE KEY `cpf` (`cpf`),  UNIQUE KEY `rg` (`rg`));
CREATE TABLE `contas` (  `numero` bigint(20) NOT NULL AUTO_INCREMENT,  `tipo` int(11) NOT NULL,  `senhan` varchar(8) NOT NULL,  `senhaa` varchar(8) NOT NULL,  `senhaw` varchar(8) NOT NULL,  PRIMARY KEY (`numero`));
CREATE TABLE `clientes` (  `cpf` bigint(20) NOT NULL,  `rg` varchar(14) NOT NULL,  `pnome` varchar(15) NOT NULL,  `mnome` varchar(100) NOT NULL,  `unome` varchar(15) NOT NULL,  `nascimento` date DEFAULT NULL,  `email` varchar(100) DEFAULT NULL,  `telefone` bigint(20) DEFAULT NULL,  `endereco` varchar(30) DEFAULT NULL,  `cidade` varchar(30) NOT NULL DEFAULT 'Caraguatatuba',  `uf` char(2) NOT NULL DEFAULT 'SP',  `cep` int(11) DEFAULT NULL,  `sexo` char(1) DEFAULT NULL,  `salario` decimal(10,2) DEFAULT NULL,  PRIMARY KEY (`cpf`),  UNIQUE KEY `rg` (`rg`));
CREATE TABLE `tiposreg` (  `numero` bigint(20) NOT NULL AUTO_INCREMENT,  `tabela` varchar(50) NOT NULL,  `atributo` varchar(50) NOT NULL,  `valor` varchar(50) NOT NULL,  PRIMARY KEY (`numero`));
CREATE TABLE `transacoes` (  `numero` bigint(20) NOT NULL AUTO_INCREMENT,  `abreviacao` char(3) DEFAULT NULL,  `tipo` int(11) DEFAULT NULL,  `valor` decimal(10,2) DEFAULT NULL,  `observacao` varchar(30) DEFAULT NULL,  PRIMARY KEY (`numero`));
CREATE TABLE `agenciaconta` (  `numeroa` bigint(20) NOT NULL,  `numeroc` bigint(20) NOT NULL,  PRIMARY KEY (`numeroa`,`numeroc`),  KEY `numeroc` (`numeroc`),  CONSTRAINT `agenciaconta_ibfk_1` FOREIGN KEY (`numeroa`) REFERENCES `agencias` (`numero`),  CONSTRAINT `agenciaconta_ibfk_2` FOREIGN KEY (`numeroc`) REFERENCES `contas` (`numero`));
CREATE TABLE `clienteconta` (  `cpf` bigint(20) NOT NULL,  `numero` bigint(20) NOT NULL,  `dataabertura` date DEFAULT NULL,  `horaabertura` time DEFAULT NULL,  PRIMARY KEY (`cpf`,`numero`),  KEY `numero` (`numero`),  CONSTRAINT `clienteconta_ibfk_1` FOREIGN KEY (`cpf`) REFERENCES `clientes` (`cpf`),  CONSTRAINT `clienteconta_ibfk_2` FOREIGN KEY (`numero`) REFERENCES `contas` (`numero`));
CREATE TABLE `clientegerente` (  `cpf` bigint(20) NOT NULL,  `registro` bigint(20) NOT NULL,  PRIMARY KEY (`cpf`,`registro`),  KEY `registro` (`registro`),  CONSTRAINT `clientegerente_ibfk_1` FOREIGN KEY (`cpf`) REFERENCES `clientes` (`cpf`),  CONSTRAINT `clientegerente_ibfk_2` FOREIGN KEY (`registro`) REFERENCES `gerentes` (`registro`));
CREATE TABLE `transacaoconta` (  `numerot` bigint(20) NOT NULL,  `numeroc` bigint(20) NOT NULL,  `tdata` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,  PRIMARY KEY (`numerot`,`numeroc`),  KEY `numeroc` (`numeroc`),  CONSTRAINT `transacaoconta_ibfk_1` FOREIGN KEY (`numerot`) REFERENCES `transacoes` (`numero`),  CONSTRAINT `transacaoconta_ibfk_2` FOREIGN KEY (`numeroc`) REFERENCES `contas` (`numero`));
